import React from 'react';

import Grid from '@material-ui/core/Grid';



const services = props => {
  return (
    <div className="">
        
        <Grid container className="center" >
        <Grid item md={2} xs={1}>
      </Grid>
      <Grid container md={8} xs={10} spacing={2}>
          
      </Grid>
      
      <Grid item md={2}>
      </Grid>
      </Grid>
</div>
  );
    
};

export default services;
